# -*- coding: utf-8 -*-
import logging
import datetime
from openerp import api, fields, models, _, SUPERUSER_ID

logging.basicConfig(level=logging.INFO)
_logger = logging.getLogger(__name__)

class PartnerToMailWizard(models.Model):
	_name = 'mail.notice'
	#此模型用来记录发件客户，发送过邮件的客户会进入此模型，用来判断客户是否发送过
	partner_id = fields.Many2one('res.partner','id',readonly=True,help='已发送邮件的对应客户')
	class_email_state = fields.Boolean(help='进班邮件')
	employment_email_state = fields.Boolean(help='就业邮件')


