	def ready_info_mail_to_mail(self, cr, SUPERUSER_ID, this_type, this_id, context=None):
		results = {}
		partner_pass = False

		#如果确认订单同时客户有班级，则此客户可发送进班邮件
		entity = self.pool[this_type].browse(cr, SUPERUSER_ID, this_id, context)
		if this_type == 'sale.order':
			if entity.state in ('sale','done'):
				entity = entity.partner_id
				if entity.kehu_id:
					partner_pass = True

		#如果客户归属班级后，此客户有订单，则此客户可发送进班邮件
		if this_type == 'res.partner':
			if entity.kehu_id:
				for p_order in entity.sale_order_ids:
					if p_order.state in ('sale','done'):
						partner_pass = True

				for c_order in entity.mapped('child_ids.sale_order_ids'):
					if c_order.state in ('sale','done'):
						partner_pass = True

		if partner_pass:
			#查找此客户是否发送过邮件，如果不存在于mail.notice模型，则创建
			partner = self.search(cr, SUPERUSER_ID, [('partner_id','=',entity.id)], context)
			if not partner:
				self.create(cr, SUPERUSER_ID,{
					'partner_id': entity.id,
					'class_email_state': True
					}, context)
			#如果此客户存在，判断是否已发送进班邮件，True则不发送，False则发送
			else:
				partner = self.browse(cr, SUPERUSER_ID, partner[0], context)
				if not partner.class_email_state:
					partner.class_email_state = True
				else:
					partner_pass = False
		# 满足发送条件的客户,准备发送内容
		if partner_pass:
			results = {
				'name': entity.name,
				'mailto': entity.res_email or entity.email,
				'class_name': entity.kehu_id.name,
				'class_leader': entity.kehu_id.class_leader.name,
				'class_core': entity.kehu_id.core.name,
				'class_address': entity.kehu_id.core.address,
				'date': datetime.datetime.now().strftime('%Y-%m-%d'),
			}
		
		return results

	def class_mail_to(self, cr, SUPERUSER_ID, partner_info):
		try:
			subject = u"""HI，%s，欢迎您加入海文的大家庭""" % (partner_info['name'])
			body = self.get_body('class',partner_info)

			vals = {'subject':subject,'body_html':body,'email_from':'@@@@@@@@@@@@@@@@@@@','email_to':partner_info['mailto'],'email_cc':'HW_Archives@163.com'}
			mail_mail_obj = self.pool['mail.mail']
			mail = mail_mail_obj.create(cr, SUPERUSER_ID, vals)
			mail_mail_obj.send(cr, SUPERUSER_ID,mail)
			return True
		except:
			return False

	def ready_info_employment_mail(self, cr, SUPERUSER_ID, this_id, context=None):
		results = {}
		partner_pass = False

		entity = self.pool['res.partner'].browse(cr, SUPERUSER_ID, this_id, context)
		#如果客户状态为已就业,则继续(这里加上就业单位，以防止未填写任何内容，却发送空邮件)
		if entity.employment_state == 'he' and (entity.employment_company or entity.employment_custom_company):
			partner = self.search(cr, SUPERUSER_ID, [('partner_id','=',entity.id)], context)
			#判断存在于mail.notice模型,不存在则创建
			if not partner:
				self.create(cr, SUPERUSER_ID,{
					'partner_id': entity.id,
					'employment_email_state': True
					}, context)
				partner_pass = True
			#如果此客户存在，判断是否已发送就业邮件，True则不发送，False则发送
			else:
				partner = self.browse(cr, SUPERUSER_ID, partner[0], context)
				if not partner.employment_email_state:
					partner.employment_email_state = True
					partner_pass = True

		# 满足发送条件的客户,准备发送内容
		if partner_pass:
			results = {
				'name': entity.name,
				'mailto': entity.res_email or entity.email,
				'company': entity.employment_custom_company if entity.employment_custom_company else entity.employment_company.name,
				'job': entity.employment_job,
				'salary': entity.employment_salary if entity.employment_salary > 0.0 else False,
				'date': datetime.datetime.now().strftime('%Y-%m-%d'),
			}

		return results

	def employment_mail(self, cr, SUPERUSER_ID, partner_info):
		try:
			subject = u"""HI，%s，恭喜您入职""" % (partner_info['name'])
			body = self.get_body('employment',partner_info)
			

			vals = {'subject':subject,'body_html':body,'email_from':'@@@@@@@@@@@@@@','email_to':partner_info['mailto']}
			mail_mail_obj = self.pool['mail.mail']
			mail = mail_mail_obj.create(cr, SUPERUSER_ID, vals)
			mail_mail_obj.send(cr, SUPERUSER_ID,mail)
			return True
		except:
			return False

	# 找出符合条件客户（进班，就业），发送邮件
	def mailtopartner(self, cr, SUPERUSER_ID):
		# 获得昨天此时
		time_bet = datetime.datetime.now() - datetime.timedelta(days=1)
		# 获得时间内班级字段被做过操作的客户，查找他们的订单是否确认，如果通过，就将这些客户作为收件人
		# 获得时间内确认过的订单，查找对应客户是否进班，如果通过，就将这些客户作为收件人
		cr.execute("SELECT id, model FROM mail_message WHERE model in ('res.partner','sale.order') and write_date > '%s'" % str(time_bet))
		results = cr.fetchall()

		class_to_student = {}
		employment_student = []
		for this_id,this_type in results:
			form_message = self.pool['mail.message'].browse(cr, SUPERUSER_ID, this_id)
			
			# mail.message取值res_id（这是相关表单的id），有时会取到一个不相干的id。这是因为此消息有父消息存在，所以需要取的是父消息res_id
			res_id = form_message.parent_id.res_id or form_message.res_id

			for track_value in form_message.tracking_value_ids:
				tv = track_value.field
				if tv == 'state' and this_type == 'sale.order':
					class_to_student['%s'%res_id] = this_type
				if tv == 'kehu_id' and this_type == 'res.partner':
					class_to_student['%s'%res_id] = this_type
				if tv.startswith('employment_') and this_type == 'res.partner':
					employment_student.append(res_id)

		if class_to_student:
			for rid,tt in class_to_student.items():
				partner_info = self.ready_info_mail_to_mail(cr, SUPERUSER_ID, tt, int(rid))
				if partner_info:
					self.class_mail_to(cr, SUPERUSER_ID, partner_info)

		if employment_student:
			for rid in list(set(employment_student)):
				partner_info = self.ready_info_employment_mail(cr, SUPERUSER_ID, rid)
				if partner_info:
					self.employment_mail(cr ,SUPERUSER_ID, partner_info)